import React, { useState } from "react";

function Checking(props) {
  const [option, setOption] = useState();

  const passingData = () => {
    this.props.parentCallback({ option });
  };
  return (
    <div>
      <input
        name="selection"
        id="teacher"
        value="teacher"
        checked={option === "teacher"}
        type="radio"
        onChange={(e) => setOption(e.target.value)}
      />
      Teacher
      <input
        name="selection"
        id="student"
        value="student"
        checked={option === "student"}
        type="radio"
        onChange={(e) => setOption(e.target.value)}
      />
      Student
      <input
        name="selection"
        id="admin"
        value="admin"
        checked={option === "admin"}
        type="radio"
        onChange={(e) => setOption(e.target.value)}
      />
      Admin
      <input
        name="selection"
        id="obecell"
        value="obecell"
        checked={option === "obecell"}
        type="radio"
        onChange={(e) => setOption(e.target.value)}
      />
      OBE Cell
    </div>
  );
}

export default Checking;
